import React from 'react'

function Posts({posts}) {
  return (
    <div className='post-flex'>
      <div>
        <h1>Posts</h1>
        <hr/>
      </div>
      <div>
           {posts.length==0?<div>
            <p>No Users selected</p>
           </div>:<div>
              {posts.map(()=>{
                <Post/>
              })}
            </div>} 
      </div>
    </div>
  )
}

export default Posts
